  return (
    <Popup isOpened={props.isOpened} onClose={''}>
      <div className="popup__tooltip-container">
        <img className="popup__tooltip-img" src={loginerr} />
        <span className="popup__tooltip-description">Что-то пошло не&nbsp;так! Попробуйте ещё раз.</span>
      </div>
    </Popup>
  );
}

export { InfoTooltip };
